import urllib.request
import re
import transliterate

def get_raw(original_url):
    url = original_url.replace('/wiki/', '/w/index.php?title=') + '&action=raw'
    page = urllib.request.urlopen(url).read().decode('utf-8')
    try:
        name = re.findall('НАЗВАНИЕ.*?=\s*(.+?)\n', page)[0]
        name = transliterate.translit(name, 'ru', reversed=True)
        print(name)
        x = open('./wikisource_raws/' + name + '.txt', 'w', encoding='utf-8')
        x.write(page)
        x.close()
    except:
        print('WRONG', url)

